  minHeight: "50px",
  textAlign: "right",
  justifyContent: 'center',
  alignItems: 'center',
}

class App extends Component {

  render() {
    return (

      <div className="App">

<div style={Head}>

        <form class="text-right search" method="GET">
            <input name="q" placeholder="Buscar" type="text" justifyContent="center"/>
        </form>
</div>
                        <div class="row">
                            <div class="col-sm-8 col-sm-offset-2 data-post">
                                <p>Lorem Ipsum Dolor si amet</p>
